def getMisspelledWords(text):
    text = unidecode.unidecode(text)
    remove_digits = str.maketrans('', '', digits)
    text = text.translate(remove_digits)
    text = text.replace('<br>', ' ')
    text = text.replace('</br>', ' ')
    text = text.replace('.com', '')
    text = text.replace("'s", "")
    text = text.replace("'", "").replace('"', '')
    text = text.replace("Wi-Fi", "").replace("wi-fi", "")
    text = re.sub(
        r"(<br>@\[A-Za-z0-9]+)|([^0-9A-Za-z \t])|(\w+:\/\/\S+)|^rt|http.+?", " ", text)
    words = text.split()
    mistakes = []
    for w in words:
        w2 = TextBlob(w)
        if (w2 != w):
            mistakes.append(w)
    return mistakes

def check(sentences, word):
    for s in sentences:
        if word.lower() == s.lower():
            return True
    return False

class UrlFunc:

    def __init__(self, id=None):
        if id is None:
            return
        result = app(
            id,
            lang='en',#parse_qs(parsed_url.query)['hl'][0],
            country='in'#parse_qs(parsed_url.query)['gl'][0]
        )
        self.title = result['title']
        self.description = result['description']
        self.icon = result['icon']
        self.score = result['score']
        self.email = result['developerEmail']
        self.comments = result['comments']
        permit = permissions(
            id,
            lang='en', # defaults to 'en'
            country='in', # defaults to 'us'
        ) #dictionary
        self.permissions = permit
        self.result = result

    def setResults(self,result):
        self.title = result['title']
        self.description = result['description']
        self.icon = result['icon']
        self.score = result['score']
        self.email = result['developerEmail']
        self.comments = result['comments']

        # permit = permissions(
        #     id,
        #     lang='en', # defaults to 'en'
        #     country='in', # defaults to 'us'
        # ) #dictionary
        # self.permissions = permit
        self.result = result

        return self

    def checkSpelling(self):
        mistakes = getMisspelledWords(self.description)
        count = len(mistakes)
        if (count == 0):
            return 's'
        elif (count > 0 and count < 5):
            return 'w'
        return 'e'

