    def computeProbability(self):
        score = {'e':0.0, 'w':0.5, 's':1.0}

        emailScore = 30 * score[self.checkEmaill()]
        spellScore = 20 * score[self.checkSpelling()]
        commentScore = 10 * score[self.checkComments()]
        rbiScore = 10 * score[self.checkRBIRegistration()]
        ratingScore = 30 * self.result['score']/5.0
        return 1 - ((emailScore + spellScore + commentScore + rbiScore + ratingScore)/100)

