def checkUrl(request):
    context={
        "error": None,
        "showResults": False,
        "spelling": "w",
        "email": "w",
        "rbi_registration": "w",
        "comments": "w"
    }
    id = None
    if (request.method=='POST'):
       
        url = request.POST.get('appurl')

        if(url is not None):
            try:
                parsed_url = urlparse(url)
                id = parse_qs(parsed_url.query)['id'][0]
            except:
                context["error"] = "Invalid url received"
        if(request.POST.get('appid') is not None):
            id = request.POST.get('appid')
    
    if id is not None:
        urlMethods = UrlFunc(id)
        context['title'] = urlMethods.title
        context['icon'] = urlMethods.icon
        context['showResults'] = True
        context['spelling'] = urlMethods.checkSpelling()
        context['email'] = urlMethods.checkEmaill()
        context['rbi_registration'] = urlMethods.checkRBIRegistration()
        context['comments'] = urlMethods.checkComments()
        context['score'] = urlMethods.score
        context['prob'] = urlMethods.getProbabilityScore()
        context['url'] = "https://play.google.com/store/apps/details/?id="+id
    return render(request, 'app/checkUrl.html', context)





def get_source(url):
    """Return the source code for the provided URL. 

    Args: 
        url (string): URL of the page to scrape.

    Returns:
        response (object): HTTP response object from requests_html. 
    """

    try:
        session = HTMLSession()
        response = session.get(url)
        return response

    except requests.exceptions.RequestException as e:
        print(e)

def scrape_google(query):

    query = urllib.parse.quote_plus(query)
    response = get_source("https://www.google.co.uk/search?q=" + query)
    # response = get_source()

    links = list(response.html.absolute_links)
    google_domains = ('https://www.google.', 
                      'https://google.', 
                      'https://webcache.googleusercontent.', 
                      'http://webcache.googleusercontent.', 
                      'https://policies.google.',
                      'https://support.google.',
                      'https://maps.google.')

    for url in links[:]:
        if url.startswith(google_domains):
            links.remove(url)

    links = [link for link in links if re.search("^https://play.google.com/store/apps/details", link)]
    return links

def get_results(keywords, date):
    links = scrape_google(f'site:play.google.com/store/apps/details after:{date} {keywords} "Finance" "India"')
    ids = [parse_qs(urlparse(url).query)['id'][0] for url in links]

    results = []
    for i, id in enumerate(ids):
        results.append(app(id,lang='en',country='in'))
        results[-1]['updated'] = datetime.datetime.fromtimestamp(results[-1]['updated'])
        results[-1]['url'] = links[i]

    return results

